import React from 'react';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css'; // Import react-calendar CSS
import './Dashboard.css'; // Your custom styles
import VerticalMenu from './Components/verticalmenu';

const Dashboard = () => {
  const patients = {
    total: 13,
    women: 1,
    men: 6,
    children: 6
  };

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <div className="sidebar">
        
        <VerticalMenu/>
      </div>

      {/* Main content */}
      <div className="main-content">
        <div className="calendar-section">
          <Calendar />
        </div>

        <div className="patient-stats">
          <div className="card patients-card">
            <h4>Patients</h4>
            <p>{patients.total}</p>
          </div>
          <div className="card women-card">
            <h4>Women</h4>
            <p>{patients.women}</p>
          </div>
          <div className="card men-card">
            <h4>Men</h4>
            <p>{patients.men}</p>
          </div>
          <div className="card children-card">
            <h4>Children</h4>
            <p>{patients.children}</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
